/* UTILITIES */



* {

  margin: 0px;

  padding: 0px;

  box-sizing: border-box;

  font-size: 100%;


}

body {

  font-family: 'Inconsolata', monospace;

}

a {

  text-decoration: none;

}

li {

  list-style: none;
  color: black;

}


/* NAVBAR STYLING STARTS */

.navbar {

  display: flex;

  position: fixed;

  width: 100%;

  align-items: center;

  justify-content: space-between;

  padding: 50px;

  background-color: transparent;

  color: #fff;

}

.nav-links a {

  color: white;
  font-family: 'Inconsolata', monospace;

}

/* LOGO */

.logo {
  margin-bottom: 22px;
  font-size: 2rem;
  color: white;
  font-family: 'Inconsolata', monospace;

}

.logo em {
  font-style: normal;
  color: #f7c552;
  font-size: 3rem;
}

/* NAVBAR MENU */

.menu {

  display: flex;

  gap: 1em;

  font-size: 18px;

}

.menu li:hover {

  background-color: black;

  border-radius: 5px;

  transition: 0.3s ease;

}

.menu li {

  padding: 5px 14px;

}



/* DROPDOWN MENU SI BESOIN ??? */

.services {

  position: relative;

}

.dropdown {

  background-color: white;

  padding: 1em 0;

  position: absolute;

  /*BELEK AU PARENT*/

  display: none;

  border-radius: 8px;

  top: 35px;

}

.dropdown li+li {

  margin-top: 10px;

}

.dropdown li {

  padding: 0.5em 1em;

  width: 8em;

  text-align: center;

}

.dropdown li:hover {

  background-color: white;

}

.services:hover .dropdown {

  display: block;

}

/*RESPONSIVE NAVBAR MENU DEBUT*/

/* CHECKBOX CACHEE */

input[type=checkbox] {

  display: none;

}

/*HAMBURGER MENU*/

.hamburger {

  display: none;

  margin-bottom: 22px;

  padding: 3px 10px 3px 10px;

  border-radius: 10%;

  border-color: #f7c552;

  background-color: #f7c552;

  color: white;

  font-size: 30px;

  user-select: none;

}

/*MEDIA QUERIES*/

@media (max-width: 768px) {

  .menu {

    display: none;

    position: absolute;

    background-color: white;

    opacity: 80%;

    right: 0;

    left: 0;

    text-align: center;

    padding: 16px 0;

  }

  .menu li:hover {

    display: inline-block;

    background-color: #f7c552;

    transition: 0.3s ease;

  }

  .nav-links a {

    color: black;
    font-family: 'Inconsolata', monospace;

  }

  .menu li+li {

    margin-top: 12px;

  }

  input[type=checkbox]:checked~.menu {

    display: block;

  }

  .hamburger {

    display: block;

  }

  .dropdown {

    left: 50%;

    top: 30px;

    transform: translateX(35%);

  }

  .dropdown li:hover {

    background-color: black;

  }

}

